import classes from './SidebarFoot.module.css'

function SidebarFoot(props){

    return(
        <div className={classes.friends}>
            Friends
        <div className={classes.friend}>
            {props.users[0].name}
            <img src={props.users[0].avatar}/></div>
        </div>
    )
}

export default SidebarFoot
